import { useState } from "react";
import { PanelBtn } from "../ui/PanelBtn/PanelBtn";
import Main from "../betting/Main";
import Game from "../betting/Game";
import Bet from "../betting/Bet";
import "./GamePanel.scss";
export const GamePanel = ({ onPanelToggle }) => {
  console.log("GamePanel onPanelToggle:", onPanelToggle);
  const [refresh, setRefresh] = useState("refresh");

  return (
    <section className="panel">
      {/* <Main></Main>
      <Game></Game>
      <Bet></Bet> */}
      <Main setRefresh={setRefresh} />
      <PanelBtn data-position="left" onClick={onPanelToggle} />
      <PanelBtn data-position="right" onClick={onPanelToggle} />
    </section>
  );
};
